import { Box } from '@mui/material'
import React from 'react'

const Employeeform = () => {
  return (
    <div>
        <Box
      sx={{
        width: 500,
        maxWidth: '100%',
      }}
    >
      <TextField fullWidth label="fullWidth" id="fullWidth" />
    </Box>
    </div>
  )
}

export default Employeeform
